import React from 'react'

const Input = ({text,handle,add}) => {
  return (
    <div className="input">
        <input type="text" placeholder="Enter The Task" value={text} onChange={handle}></input>
        <button onClick={add}>+</button>
      </div>
  )
}

export default Input
